daan[3029] = '\u8bf1\u53d1\u57fa\u56e0\u8f6c\u79fb\u8de8\u8d8a\u7269\u79cd\u5c4f\u969c\u000a\u57fa\u56e0\u6c61\u67d3\u000a\u98df\u7269\u94fe\u7684\u7834\u574f';
timu[3030] = '\u5b9e\u9a8c\u5ba4\u5206\u533a\u7684\u5185\u5bb9\u6709';
daan[3030] = '\u6e05\u6d01\u533a\u000a\u534a\u6c61\u67d3\u533a\u000a\u6c61\u67d3\u533a';
timu[3031] = '\u5fae\u751f\u7269\u6c14\u6eb6\u80f6\u5bf9\u5b9e\u9a8c\u5ba4\u5de5\u4f5c\u4eba\u5458\u90fd\u5177\u6709\u4e25\u91cd\u7684\u5371\u5bb3\u6027\u5176\u7a0b\u5ea6\u53d6\u51b3\u4e8e\u4ee5\u4e0b\u54ea\u51e0\u9879\u6761\u4ef6';
daan[3031] = '\u5fae\u751f\u7269\u672c\u8eab\u7684\u6bd2\u529b\u000a\u6c14\u6eb6\u80f6\u7684\u6d53\u5ea6\u000a\u6c14\u6eb6\u80f6\u7c92\u5b50\u5927\u5c0f\u000a\u5f53\u65f6\u5b9e\u9a8c\u5ba4\u5185\u7684\u5fae\u5c0f\u6c14\u5019\u6761\u4ef6';
timu[3032] = '\u52a8\u7269\u5b9e\u9a8c\u4ea7\u751f\u7684\u5e9f\u5f03\u7269\u7684\u8fd0\u9001\u8d2e\u5b58\u5904\u7f6e\u6309\u7167\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u56fa\u4f53\u5e9f\u5f03\u7269\u6c61\u67d3\u73af\u5883\u9632\u6cbb\u6cd5\u8fdb\u884c\u5904\u7406\u52a8\u7269\u5b9e\u9a8c\u4ea7\u751f\u7684\u5e9f\u5f03\u7269\u53ef\u5bf9\u4eba\u548c\u5468\u56f4\u73af\u5883\u9020\u6210\u4e25\u91cd\u7684\u751f\u7269\u5371\u5bb3\u5fc5\u987b\u600e\u6837\u5904\u7f6e';
daan[3032] = '\u4e13\u4e1a\u7684\u5e9f\u5f03\u7269\u5904\u7406\u90e8\u95e8\u000a\u4ea4\u5b66\u6821\u5b9e\u9a8c\u52a8\u7269\u5c38\u9ab8\u56de\u6536\u70b9\u7edf\u4e00\u5904\u7f6e';
timu[3033] = '\u4e0b\u5217\u54ea\u9879\u662f\u6211\u56fd\u6709\u5173\u57fa\u56e0\u5de5\u7a0b\u64cd\u4f5c\u7684\u7ba1\u7406\u89c4\u5b9a';
daan[3033] = '\u300a\u57fa\u56e0\u5de5\u7a0b\u5b89\u5168\u7ba1\u7406\u529e\u6cd5\u300b\u000a\u300a\u519c\u4e1a\u751f\u7269\u57fa\u56e0\u5de5\u7a0b\u5b89\u5168\u7ba1\u7406\u5b9e\u65bd\u529e\u6cd5\u300b';
timu[3034] = '\u5b9e\u9a8c\u5ba4\u7533\u8bf7\u8fd0\u8f93\u9ad8\u81f4\u75c5\u6027\u75c5\u539f\u5fae\u751f\u7269\u83cc\u6bd2\u79cd\u6216\u6837\u672c\u5e94\u63d0\u4ea4\u7684\u6750\u6599\u5305\u62ec';
daan[3034] = '\u9ad8\u81f4\u75c5\u6027\u75c5\u539f\u5fae\u751f\u7269\u83cc\uff08\u6bd2\uff09\u79cd\u6216\u6837\u672c\u8fd0\u8f93\u7533\u8bf7\u8868\u000a\u6cd5\u4eba\u8d44\u683c\u8bc1\u660e\u6750\u6599\u000a\u63a5\u6536\u5355\u4f4d\u540c\u610f\u63a5\u6536\u7684\u8bc1\u660e\u6587\u4ef6\u000a\u5bb9\u5668\u6216\u5305\u88c5\u6750\u6599\u7684\u6279\u51c6\u6587\u53f7\u3001\u5408\u683c\u8bc1\u4e66\uff08\u590d\u5370\u4ef6\uff09\u6216\u8005\u9ad8\u81f4\u75c5\u6027\u75c5\u539f\u5fae\u751f\u7269\u83cc\uff08\u6bd2\uff09\u79cd\u6216\u6837\u672c\u8fd0\u8f93\u5bb9\u5668\u6216\u5305\u88c5\u6750\u6599\u627f\u8bfa\u4e66\u000a\u5176\u5b83\u6709\u5173\u8d44\u6599';
timu[3035] = '\u5173\u4e8e\u0049\u0049\u7ea7\u751f\u7269\u5b89\u5168\u9632\u62a4\u5b9e\u9a8c\u5ba4\u8bbe\u8ba1\u8981\u6c42\u63cf\u8ff0\u6b63\u786e\u7684\u6709';
daan[3035] = '\u5e94\u8bbe\u7f6e\u5b9e\u65bd\u5404\u79cd\u6d88\u6bd2\u65b9\u6cd5\u7684\u8bbe\u65bd\uff0c\u5982\u9ad8\u538b\u706d\u83cc\u9505\u3001\u5316\u5b66\u6d88\u6bd2\u88c5\u7f6e\u7b49\u5bf9\u5e9f\u5f03\u7269\u8fdb\u884c\u5904\u7406\u3002\u000a\u5e94\u8bbe\u7f6e\u6d17\u773c\u88c5\u7f6e\u000a\u5b9e\u9a8c\u5ba4\u95e8\u5b9c\u5e26\u9501\u3001\u53ef\u81ea\u52a8\u5173\u95ed\u000a\u5b9e\u9a8c\u5ba4\u51fa\u53e3\u5e94\u6709\u53d1\u5149\u6307\u793a\u6807\u5fd7\u000a\u5b9e\u9a8c\u5ba4\u5b9c\u6709\u4e0d\u5c11\u4e8e\u6bcf\u5c0f\u65f6\u0033\uff5e\u0034\u6b21\u7684\u901a\u98ce\u6362\u6c14\u6b21\u6570';
timu[3036] = '\u5b9e\u9a8c\u5ba4\u7ba1\u7406\u5c42\u8d1f\u8d23\u786e\u4fdd\u6267\u884c\u5b89\u5168\u68c0\u67e5\u6bcf\u5e74\u5e94\u5bf9\u5de5\u4f5c\u573a\u6240\u81f3\u5c11\u8c03\u67e5\u68c0\u67e5\u4e00\u6b21\u4ee5\u4fdd\u8bc1';
daan[3036] = '\u706b\u707e\u5e94\u6025\u88c5\u5907\u3001\u8b66\u62a5\u7cfb\u7edf\u548c\u64a4\u79bb\u7a0b\u5e8f\u7684\u529f\u80fd\u53ca\u72b6\u6001\u6b63\u5e38\u000a\u7528\u4e8e\u5371\u9669\u7269\u8d28\u6f0f\u51fa\u9632\u62a4\u7a0b\u5e8f\u548c\u7269\u54c1\u0028\u5305\u62ec\u7d27\u6025\u55b7\u6dcb\u0029\u7684\u72b6\u6001\u6b63\u5e38\u000a\u5bf9\u53ef\u71c3\u3001\u6613\u71c3\u3001\u6709\u611f\u67d3\u6027\u3001\u6709\u653e\u5c04\u6027\u548c\u6709\u6bd2\u7269\u8d28\u7684\u5b58\u653e\u8fdb\u884c\u9002\u5f53\u7684\u9632\u62a4\u548c\u63a7\u5236\u000a\u53bb\u6c61\u67d3\u548c\u5e9f\u7269\u5904\u7406\u7a0b\u5e8f\u7684\u72b6\u6001\u6b63\u5e38\u000a\u5b9a\u671f\u7684\u5b89\u5168\u68c0\u67e5\u6709\u52a9\u4e8e\u63d0\u9192\u6240\u6709\u4eba\u5458\u6ce8\u610f\u6f5c\u5728\u7684\u5371\u9669\uff0c\u786e\u4fdd\u670d\u4ece\u6709\u5173\u89c4\u5b9a\uff0c\u5e76\u5f3a\u5316\u76d1\u7763\u5458\u7684\u8d23\u4efb\u5fc3';
timu[3037] = '\u5173\u4e8e\u5b9e\u9a8c\u5ba4\u901a\u98ce\u8bbe\u8ba1\u5e94\u6ce8\u610f\u4e8b\u9879\u6709';
daan[3037] = '\u5e94\u5c06\u53ef\u80fd\u4ea7\u751f\u8fc7\u591a\u70df\u96fe\u3001\u6c14\u5473\u7b49\u8bbe\u5907\u4e0e\u666e\u901a\u5de5\u4f5c\u533a\u9694\u79bb\u5e76\u5b89\u88c5\u9002\u5f53\u7684\u6392\u98ce\u7f69\u000a\u5bf9\u53ef\u80fd\u4ea7\u751f\u4e0d\u826f\u6c14\u5473\u7684\u64cd\u4f5c\u8fc7\u7a0b\u53ef\u91c7\u7528\u5c40\u90e8\u7684\u81ea\u7136\u6216\u4eba\u5de5\u901a\u98ce\u000a\u5e94\u5bf9\u7a7a\u6c14\u7684\u6d41\u52a8\u901f\u5ea6\u8fdb\u884c\u5b9a\u671f\u76d1\u6d4b\u4ee5\u4fdd\u8bc1\u8db3\u591f\u7684\u901a\u98ce\u000a\u901a\u98ce\u7ba1\u9053\u5e94\u4e0e\u666e\u901a\u5de5\u4f5c\u533a\u9694\u79bb\uff0c\u4ee5\u9632\u6b62\u7a7a\u6c14\u4f20\u64ad\u7684\u611f\u67d3\u56e0\u5b50\u6216\u6c14\u5473\u6269\u6563';
timu[3038] = '\u5173\u4e8e\u751f\u7269\u5b89\u5168\u67dc\u5316\u5b66\u5b89\u5168\u7f69\u53ca\u67dc\u63cf\u8ff0\u6b63\u786e\u7684\u6709';
daan[3038] = '\u751f\u7269\u5b89\u5168\u67dc\u548c\u5316\u5b66\u5b89\u5168\u7f69\u5e94\u7531\u6709\u8d44\u683c\u7684\u4eba\u5458\u5b89\u88c5\u5e76\u6bcf\u5e74\u9a8c\u8bc1\u000a\u6240\u7528\u751f\u7269\u5b89\u5168\u67dc\u7684\u653e\u7f6e\u3001\u8bbe\u8ba1\u548c\u7c7b\u578b\u5e94\u7b26\u5408\u5b89\u5168\u5de5\u4f5c\u6240\u8981\u6c42\u7684\u98ce\u9669\u9632\u62a4\u7b49\u7ea7\u000a\u751f\u7269\u5b89\u5168\u67dc\u3001\u5316\u5b66\u5b89\u5168\u7f69\u548c\u67dc\u7684\u901a\u98ce\u5e94\u7b26\u5408\u5fae\u751f\u7269\u548c\u0028\u6216\u0029\u5316\u5b66\u7684\u98ce\u9669\u7b49\u7ea7\u548c\u5b89\u5168\u8981\u6c42';
timu[3039] = '\u5b9e\u9a8c\u52a8\u7269\u5c38\u4f53\u7684\u5904\u7406\u65b9\u6cd5\u6709';
daan[3039] = '\u4e0d\u5f97\u711a\u70e7\u002c\u5fc5\u987b\u653e\u5728\u6307\u5b9a\u7684\u52a8\u7269\u5c38\u4f53\u56de\u6536\u51b0\u67dc\u5185\u000a\u505a\u597d\u76f8\u5173\u7684\u8bb0\u5f55\u002c\u5982\u5355\u4f4d\u3001\u540d\u79f0\u3001\u6570\u91cf\u7b49';
timu[3040] = '\u751f\u7269\u5b9e\u9a8c\u5e9f\u5f03\u7269\u7684\u5904\u7406\u65b9\u6cd5\u6709';
daan[3040] = '\u53c2\u7167\u56fd\u5bb6\u9881\u5e03\u7684\u300a\u533b\u7597\u5e9f\u5f03\u7269\u7ba1\u7406\u6761\u4f8b\u300b\u000a\u6536\u96c6\u533b\u7597\u5e9f\u5f03\u7269\u4f7f\u7528\u7684\u5bb9\u5668\u6216\u4e13\u7528\u5305\u88c5\u5e94\u5f53\u7b26\u5408\u300a\u533b\u7597\u5e9f\u5f03\u7269\u4e13\u7528\u5305\u88c5\u888b\u3001\u5bb9\u5668\u548c\u8b66\u793a\u6807\u5fd7\u6807\u51c6\u300b\u7684\u89c4\u5b9a\u000a\u6309\u7167\u56fd\u5bb6\u7684\u76f8\u5173\u89c4\u5b9a\u8fdb\u884c\u5206\u7c7b\u5904\u7406\u002c\u6240\u6709\u611f\u67d3\u6027\u6750\u6599\u5fc5\u987b\u5728\u5b9e\u9a8c\u5ba4\u5185\u6e05\u9664\u6c61\u67d3\u3001\u9ad8\u538b\u706d\u83cc\u706d\u6d3b\u000a\u6309\u89c4\u5b9a\u7684\u65f6\u95f4\u5c06\u65e0\u7834\u635f\u3001\u65e0\u6e17\u900f\u7684\u533b\u7597\u5e9f\u5f03\u7269\u7269\u4e13\u7528\u5305\u88c5\u888b\u7b49\u9001\u8fbe\u5b66\u6821\u751f\u7269\u5e9f\u5f03\u7269\u56de\u6536\u70b9\u002c\u7531\u5b66\u6821\u7edf\u4e00\u5904\u7406';
timu[3041] = '\u5982\u4e0b\u54ea\u4e9b\u5e9f\u5f03\u7269\u987b\u653e\u5728\u5229\u5668\u76d2\u4e2d\u5904\u7f6e';
daan[3041] = '\u6ce8\u5c04\u9488\u5934\u000a\u73bb\u7483\u5b89\u74ff\u000a\u624b\u672f\u5200\u7247';
timu[3042] = '\u5728\u751f\u7269\u5b89\u5168\u5b9e\u9a8c\u5ba4\u7a7a\u8c03\u51c0\u5316\u7cfb\u7edf\u8bbe\u8ba1\u4e2d\u4e0b\u5217\u54ea\u51e0\u9879\u662f\u9519\u8bef\u7684';
daan[3042] = '\u4e00\u7ea7\u81f3\u56db\u7ea7\u751f\u7269\u5b89\u5168\u5b9e\u9a8c\u5ba4\u4e0d\u5e94\u91c7\u7528\u6709\u5faa\u73af\u98ce\u7684\u7a7a\u8c03\u7cfb\u7edf\u000a\u4e00\u7ea7\u81f3\u56db\u7ea7\u751f\u7269\u5b89\u5168\u5b9e\u9a8c\u5ba4\u53ef\u4ee5\u91c7\u7528\u6709\u5faa\u73af\u98ce\u7684\u7a7a\u8c03\u7cfb\u7edf\u000a\u4e00\u7ea7\u548c\u4e8c\u7ea7\u751f\u7269\u5b89\u5168\u5b9e\u9a8c\u5ba4\u5e94\u91c7\u7528\u5168\u65b0\u98ce\u7a7a\u8c03\u7cfb\u7edf';
timu[3043] = '\u4e0b\u9762\u54ea\u4e9b\u5185\u5bb9\u5c5e\u4e8e\u4e00\u7ea7\u751f\u7269\u5b89\u5168\u9632\u62a4\u5b9e\u9a8c\u5ba4\u7684\u6ce8\u610f\u4e8b\u9879';
daan[3043] = '\u4e00\u822c\u65e0\u987b\u4f7f\u7528\u751f\u7269\u5b89\u5168\u67dc\u7b49\u4e13\u7528\u5b89\u5168\u8bbe\u5907\u000a\u5de5\u4f5c\u4eba\u5458\u5728\u8bd5\u9a8c\u65f6\u5e94\u7a7f\u5de5\u4f5c\u670d\uff0c\u6234\u9632\u62a4\u773c\u955c\u000a\u5de5\u4f5c\u4eba\u5458\u624b\u4e0a\u6709\u76ae\u80a4\u7834\u635f\u6216\u76ae\u75b9\u65f6\u5e94\u6234\u624b\u5957';
timu[3044] = '\u4e09\u7ea7\u751f\u7269\u5b89\u5168\u9632\u62a4\u5b9e\u9a8c\u5ba4\u7684\u5b9e\u9a8c\u5ba4\u7ed3\u6784\u548c\u8bbe\u65bd\u5b89\u5168\u64cd\u4f5c\u89c4\u7a0b\u5b89\u5168\u8bbe\u5907\u9002\u7528\u4e8e';
daan[3044] = '\u4e3b\u8981\u901a\u8fc7\u547c\u5438\u9014\u5f84\u4f7f\u4eba\u4f20\u67d3\u4e0a\u4e25\u91cd\u7684\u751a\u81f3\u662f\u81f4\u6b7b\u75be\u75c5\u7684\u81f4\u75c5\u5fae\u751f\u7269\u53ca\u5176\u6bd2\u7d20\u000a\u827e\u6ecb\u75c5\u7684\u75c5\u6bd2\u7814\u7a76';
timu[3045] = '\u5728\u4e0b\u5217\u54ea\u79cd\u60c5\u51b5\u4e0b\u5e94\u4f7f\u7528\u751f\u7269\u5b89\u5168\u67dc';
daan[3045] = '\u64cd\u4f5c\u4f20\u67d3\u6027\u7269\u8d28\u000a\u5b9e\u9a8c\u8fc7\u7a0b\u4e2d\u4ea7\u751f\u6c14\u6eb6\u80f6\u7684\u5371\u9669\u6027\u8f83\u5927\u65f6\u002c\u5305\u62ec\u7814\u78e8\u3001\u79bb\u5fc3\u3001\u8d85\u58f0\u7834\u788e\u7b49';
